import MovieRow from "../../../components/MovieRow";

export default function MovieLists({movieList, setMovieInfo, openMoreInfo}){
  return(
    <section className="lists">
        {movieList.map((item, key) => (
          <MovieRow
            key={key}
            title={item.title}
            items={item.items}
            setProps={movieInfo}
            onClickItem={openMoreInfo}
          />
        ))}
      </section>
  )
}
